import React from 'react';

const MatrixTable = ({ classData }) => {
  return (
    <table border="1">
      <thead>
        <tr>
          <th>Class Name</th>
          {/* Render the header row dynamically */}
          {classData.length > 0 &&
            Object.keys(classData[0].paymentParticulars).map((particular, index) => (
              <th key={index}>{particular}</th>
            ))}
        </tr>
      </thead>
      <tbody>
        {/* Render class data dynamically */}
        {classData.map((classItem, idx) => (
          <tr key={idx}>
            <td>{classItem.className}</td>
            {Object.values(classItem.paymentParticulars).map((particular, index) => (
              <td key={index}>{particular}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default MatrixTable;
